import React from "react";
import "./App.css";

/**
 * Header
 * - Logo
 * - Nav Items (Right Side)
 * - Car
 *
 * Body
 * - Search Bar
 * - RestaurantCard
 *    - Image
 *    - Name
 *    - Rating
 *    - Cuisines
 *
 * Footer
 *    - links
 *    - copyright
 */
const Title = () => {
  // return <h1 className="header-name">HungryFoods</h1>;
  return (
    <a href="/">
      <img className="logo" src="hungry-foods-logo.png" alt="app logo" />
    </a>
  );
};

const Header = () => {
  return (
    <div className="App-header">
      <Title />
      <div className="nav-items">
        <ul>
          <li>Home</li>
          <li>Aobut</li>
          <li>Contact</li>
          <li>Cart</li>
        </ul>
      </div>
    </div>
  );
};

const RestaurantCard = () => {
  return (
    <div className="card">
      <img src="https://media-assets.swiggy.com/swiggy/image/upload/fl_lossy,f_auto,q_auto,w_660/ee5f8e06b300efc07c9fe3f4df40dfc4" />
      <h2>McDonalds</h2>
      <h3>Burgers, Beverages, Cafe Deserts</h3>
      <h4>4.4 stars</h4>
    </div>
  )
}

const Body = () => {
  return (
    <div>
      <RestaurantCard />
    </div>
    );
};

const Footer = () => {
  return <h1>Footer</h1>;
};

const AppLayout = () => {
  return (
    <React.Fragment>
      <Header />
      {/* <React.Fragment> */}
        <Body />
        <Footer />
      {/* </React.Fragment> */}
    </React.Fragment>
  );
};

function App() {
  return <AppLayout />;
}

export default App;
